import React, { Component } from 'react';
import './ImageGrid.css';

class ImageGrid extends Component {
  render() {
    return (
      <div>
        <div class="container">
        	<div class="row">
	        	<div class="col-lg-3 pink">COL LG 6</div>
	        	<div class="col-lg-3 pink">COL LG 6</div>
	        	<div class="col-lg-3 pink">COL LG 6</div>
	        	<div class="col-lg-3 pink">COL LG 6</div>


        	</div>
        </div>
      </div>
    );
  }
}

export default ImageGrid;
